class Header extends React.Component {
  render() {
    return (
      <div>
        <img src="../../frontend/public/logo_Dabyss.png" />
        <h1>Minigame Dabyss</h1>
        <p>ゲーム一覧</p>
        <p>ブログ</p>
        <p>お問い合わせ</p>
      </div>
    );
  }
}

export default Header;
